import React from "react";
import { Formik } from "formik";
import Navbar from "../../components/Navbar/Navbar";
import "./Sign.css";

function SignPage() {
  return (
    <div className="sign-page">
      <Navbar login />
      <div className="form-container">

        <Formik
        className="formik-container"
          initialValues={{ email: "",username:"", password: "" }}          
          onSubmit={(values, { setSubmitting }) => {
            setTimeout(() => {
              alert(JSON.stringify(values, null, 2));
              setSubmitting(false);
            }, 400);
          }}
        >
          {({
            values,
            errors,
            touched,
            handleChange,
            handleBlur,
            handleSubmit,
            isSubmitting,
            /* and other goodies */
          }) => (
            <form className="input-container" onSubmit={handleSubmit}>
              <div className="sign-form-title">
                <p>Yeni bir hesap olustur</p>
              </div>
              <div className="text-input-container">
              <div className="input-title">E-mail</div>
              <input
                className="text-input"
                type="email"
                name="email"
                onChange={handleChange}
                onBlur={handleBlur}
                value={values.email}
              />

              </div>
               <input
                className="text-input"
                placeholder="Username"
                type="username"
                name="username"
                onChange={handleChange}
                onBlur={handleBlur}
                value={values.username}
              />
              <input
                className="text-input"
                placeholder="Password"
                type="password"
                name="password"
                onChange={handleChange}
                onBlur={handleBlur}
                value={values.password}
              />
              <button className="btn-form" type="submit" disabled={isSubmitting}>
                Sign in
              </button>
            </form>
          )}
        </Formik>
        <img className="form-img" src="./images/movie-boy.svg" />
      </div>
    </div>
  );
}

export default SignPage;
